import logo from './images/netflix-Logo.svg';

function Header() {
  return (
    <>
      <nav classname="">
        <div classname="container">
          <a classname="" href="#">
            <img src = {logo} alt = "logo"
              
            />
          </a>
        </div>
      </nav>
    </>
  );
}

export default Header;
